import { SET_CURRENCIES } from "../actions/actionTypes";

const INITIAL_STATE = {
  currencies: [],
  expenses: [],
  editor: false,
  idToEdit: 0,
};

const walletReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  case SET_CURRENCIES:
  default:
    return state;
  }
};

export default walletReducer;
